import './App.css';

function Login() {
  return (
      <div className="App-container">

      <div className="login-block">
        <h2 className="signin-header">Sign In</h2>

        <div className="login-input">
          <input type="email" id="loginEmail" placeholder="Email address"></input>
        </div>

        <div className="login-input">
          <input type="password" id="loginPassword" placeholder="Password"></input>
        </div>


        <button className="login-button btn btn-dark">Login</button>
        <button className="login-button btn btn-dark">Sign Up</button>
      </div>
      </div>
  );
}

export default Login;
